import React from "react"
import Joke from "./Joke"

function App() {
  return(
    <div>
        <Joke
          joke={{question: "Co to znaczy jak daltoniście nie smakuje marchewka?", punchline: "Kolejna pierniczona pietruszka!"}}
        />
        <Joke
          joke={{question: "Jak się nazywa samolot przewożący owce?", punchline: "Transportowiec"}}
        />
        <Joke
          joke={{question: "Ile żyje robak wędkarza?", punchline: "Dwa dni z hakiem"}}
        />
        <Joke
          joke={{question: "Który lekarz nigdy nie stosuje przedłużaczy?", punchline: "Pierwszego kontaktu!"}}
        />
        <Joke
          joke={{question: "Jak się nazywa czworonożny przyjaciel człowieka?", punchline: "Tapczan"}}
        />
        <Joke
          joke={{question: "", punchline: "Tapczan"}}
        />
    </div>
  )
}

export default App
